import React from 'react';

function Home({ user }) {
  return (
    <div className="p-4">
      <h2 className="text-lg font-bold mb-4">Welcome, {user.name}!</h2>
      <p>You're now logged in. Predictions will go here.</p>
    </div>
  );
}

export default Home;
